import { View, StyleSheet } from 'react-native'
import Constants from 'expo-constants'

const styles = StyleSheet.create({
	container: {
		paddingTop: Constants.statusBarHeight,
		display: 'flex'
	}
})

const AppBar = () => {
	return (
		<View style={styles.container}>

		</View>
	)
}

export default AppBar
